import React from "react";
import { Col, Row } from "react-bootstrap";
import backgroundImg from "./images/bg1.jpg";

import img1 from "./images/img1.jpg";
import img2 from "./images/img2.jpg";
import img3 from "./images/img3.jpg";

//Defines the content page of website, which holds banner and side images
export default function ContainerComp() {
  return (
    <Row>
      <Col xs={12} md={9}>
        <img src={backgroundImg} width={"100%"} height="100%" />
      </Col>
      <Col xs={12} md={3}>
        <img src={img1} width={"100%"} />
        <img src={img2} width={"100%"} className="mt-4" />
        <img src={img3} width={"100%"} className="mt-4" />
      </Col>
    </Row>
  );
}
